As dicas não são minhas. Veja os créditos no final.
  Após realizar a prova, faça parte de algum grupo que luta em defesa da Universidade. Se o Brasil continuar no rumo em que está, não haverá Universidade Pública para você;
  Não reproduza o discurso da elite que quer te ver fora do espaço que ela tem certeza que é dela. Universidade é um direito, não um privilégio.
